import{_ as e,o as a,c as t,O as i}from"./chunks/framework.9482e208.js";const f=JSON.parse('{"title":"§ 51.5-123 Community Rehabilitation Case Management System.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/51.5-123.md","filePath":"vacode/51.5-123.md"}'),n={name:"vacode/51.5-123.md"},o=i('<h1 id="§-51-5-123-community-rehabilitation-case-management-system" tabindex="-1">§ 51.5-123 Community Rehabilitation Case Management System. <a class="header-anchor" href="#§-51-5-123-community-rehabilitation-case-management-system" aria-label="Permalink to &quot;§ 51.5-123 Community Rehabilitation Case Management System.&quot;">​</a></h1><p>The Department shall develop and implement a community rehabilitation case management system. Such system shall provide for the coordination of medical, psychosocial, vocational, rehabilitative, long-term care, and family and community support services for persons with significant physical or sensory disabilities.</p><p>The Department shall facilitate the provision of such services by the Department and any other state, local, public, or private nonprofit agency, organization, or facility to such persons.</p><p>1989, c. 176, § 51.5-9.2; 2012, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?121+ful+CHAP0803" target="_blank" rel="noreferrer">803</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?121+ful+CHAP0835" target="_blank" rel="noreferrer">835</a>; 2014, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0289" target="_blank" rel="noreferrer">289</a>.</p>',4),r=[o];function s(c,l,m,h,p,_){return a(),t("div",null,r)}const g=e(n,[["render",s]]);export{f as __pageData,g as default};
